function MedicalAnswerPage() {
    return (
      <div className="container" style={{display:"flex",alignItems:"center",justifyContent:'center'}}>
        <h1>Medical Question</h1>
        <p>Here is a question referred in medical terms:</p>
        <p>What is the diagnosis for a person with high blood pressure?</p>
      </div>
    );
  }
  export default MedicalAnswerPage;
